  @Input("value") value!:any;
  myChart :any;
  clickEventSubscription: Subscription;
  constructor(private SharedService:SharedService) {
    this.clickEventSubscription=this.SharedService.getClickEvent().subscribe((value)=>{
      if(value.func==="init"){
        this.initChart();
        this.myChart.data.datasets[0].label=value.datasetLabel
        this.myChart.update()
      }
      else if(value.func==="initSimple"){
        let data=this.initSimpleData(value.value);
        this.initSimpleGraph(data);
      }
      else if(value.func==="addValue"){
        this.addValue(value.value,value.backgroundColor,value.borderColor,value.label)
        this.myChart.data.datasets[0].label=value.datasetLabel
        this.myChart.update()
      }
      else if(value.func==="clear"){
        this.clear([]);

      }
      else if(value.func==="default"){
        this.setDefault();
      }
      else if(value.func==="badRequest"){
        this.setBadRequest();
      }
      else if(value.func==="addValueStacked"){
        this.addValueStacked(value.value,value.columnLabel,value.fontLabel);
      }
      else if(value.func==="initLineStackedGraph"){
        let data=this.initLineStackedData(value.value);
        this.initLineStackedGraph(data);
      }
      else if(value.func==="addValueLineStacked"){
        this.addValueLineStacked(value.value,value.columnLabel,value.fontLabel);
      }
      else if(value.func==="initLineUnstackedGraph"){
        let data=this.initLineStackedData(value.value);
        this.initLineUnstackedGraph(data);
      }
      else if(value.func==="initBubbleGraph"){
        let data=this.initLineStackedData(value.value);
        this.initBubblesGraph(data);
      }
      else if(value.func==="addValueBubbleGraph"){
        this.addValueBubbles(value.value,value.clusterLabel,value.bubbleLabel);
      }


    })
  }


